  return (
    <p>{props.part} {props.exercise}</p>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part part={props.parts[0].name} exercises={props.parts[0].exercises} />
    </div>
  )
}

const Total = (props) => {
  return (
    <p>The number of exercises {props.total}</p>
  )
}

const App = () => {

  const course = {
    name: 'Half stack application development',
